INSERT INTO `tn` (`id`, `tn`, `korisnik`) VALUES
(0000000001, 'Rok plaćanja računa je 30 dana.', 0),
(0000000002, 'Reklamacije na vraćenu robu vršimo 8 dana nakon primitka računa, uz predočenje orginalnog računa i ispravne robe.', 0),
(0000000003, 'Obračunat PDV u skladu sa Zakonom o porezu na dodanu vrijednost (\"Službeni glasnik BiH\", broj 9/05 i 35/05)', 0),
(0000000004, 'U slučaju neplaćanja u valutnom roku, prema članu 24. Zakona o finansijskom poslovanju, dužnik će biti kažnjen novčanom kaznom u iznosu od 5.000,00 do 15.000,00 KM, kao i odgovorno lice dužnika kaznom od 1.500,00 do 3.000,00 KM.', 0),
(0000000005, 'Za svaki dan kašnjenja u plaćanju, prema odredbama člana 13. i 14. Zakona o finansijskom poslovanju, dužni ste nam platiti zakonsku zateznu kamatu na neplaćeni iznos, kao i posebnu naknadu u iznosu od 100,00 KM po računu. Reklamacije na račun uvažavamo u roku od 8 dana od datuma računa.', 0),
(0000000006, 'Kupac potpisom potvrđuje da su naznačene robe/usluge isporučene/izvršene.', 0);
